import './App.css';
import Navbar from './components/Navbar/Navbar';
import Splash from './components/Splash';
import Plans from './components/Parent/Plans';
import Counter from '.components/Counter/counter';
import PlusButton from '.components/Counter/plus_button';
import MinusButton from './components/Counter/minus_button';

function App() {
  return (
    <div className="App">
      <Navbar />
      <Splash />
      <div>
        <Counter count={this.state.count} />
        <PlusButton count={this.state.count} increaseCount={(count) => this.setState({count})}/>
        <MinusButton count={this.state.count} decreaseCount={(count) => this.setState({count})}/>
      </div>

      <Plans />
    </div>
  );
}

export default App;
